# helper: robustly read any delimited file as pandas DataFrame
def safe_read(path):
    """Try to read a tabular file regardless of delimiter.
       Returns (df, error_msg).  If df is None reading failed."""
    for sep in [",", "\t", ";", "|"]:
        try:
            df = pd.read_csv(path, sep=sep, nrows=5)  # just first rows
            return df, None
        except Exception as e:
            last_error = str(e)
    return None, last_error

base_dir = "/home/gridsan/elai/Kramabench/data/environment/input/./"

# ---------------- subtask-1: list files ---------------------------------------
file_paths = []
for root, _, files in os.walk(base_dir):
    for f in files:
        # skip hidden files
        if f.startswith(".") or f.endswith(".zip") or f.endswith(".gz"):
            continue
        file_paths.append(os.path.join(root, f))

# ---------------- subtask-2: peek into headers and search for precipitation ---
candidate_files = []
precip_keywords = {"precip", "rain", "ppt"}
for path in file_paths:
    df_head, err = safe_read(path)
    if df_head is None:
        continue
    # standardise columns to lower case & strip
    cols = {c.lower().strip() for c in df_head.columns.astype(str)}
    # look for any keyword AND a year column
    if (cols & precip_keywords) and ("year" in cols or any(c.endswith("year") for c in cols)):
        candidate_files.append(os.path.basename(path))

# --------------- subtask-3: the result ---------------------------------------
answers = {
    "subtask-1": sorted([os.path.basename(p) for p in file_paths]),
    "subtask-2": {os.path.basename(p): list(pd.read_csv(p, nrows=0).columns)
                  for p in candidate_files},
    "subtask-3": candidate_files or ["<no file with yearly precipitation found>"],
    # main task is the same as subtask-3 for this question
    "main-task": candidate_files or ["<no file with yearly precipitation found>"]
}

print(json.dumps(answers, indent=4))

