placeholder_candidates = set()
month_cols = ['Jan','Feb','Mar','Apr','May','Jun','Jul','Aug','Sep','Oct','Nov','Dec']
for file_name, path in paths.items():
    # read each file forcing everything to string so we can look for text placeholders
