import os
import json
import pandas as pd
import re

# ---------- Parameters ----------
DATA_DIR = "/home/gridsan/elai/Kramabench/data/environment/input/./"

# ---------- Helper functions ----------
def safe_listdir(path):
    try:
        return sorted(os.listdir(path))
    except FileNotFoundError:
        return []

def is_water_test_file(filename):
    keywords = ["water", "beach", "testing", "quality"]
    lower = filename.lower()
    return any(k in lower for k in keywords)

def contains_2015(filename):
    return re.search(r"2015", filename) is not None

def file_has_year_2015(full_path):
    """
    Open the file quickly (if CSV/TSV/Parquet) and see whether any column
    called Year / year / YEAR (or column 0) contains 2015.
    """
    try:
        # Only attempt for CSV files
        if full_path.lower().endswith(".csv"):
            # read only first 500 rows to be fast
            df = pd.read_csv(full_path, nrows=500)
            # find year column heuristically
            for col in df.columns:
                if "year" in col.lower():
                    # coerce to str then numeric
                    vals = pd.to_numeric(df[col], errors="coerce")
                    if (vals == 2015).any():
                        return True
        # Add more handlers if needed (e.g., parquet / excel)
    except Exception:
        pass
    return False

# ---------- Sub-task 1 ----------
all_files = safe_listdir(DATA_DIR)

# ---------- Sub-task 2 ----------
candidate_water_files = [f for f in all_files if is_water_test_file(f)]

# ---------- Sub-task 3 ----------
candidate_2015_files = []
for f in candidate_water_files:
    if contains_2015(f):
        candidate_2015_files.append(f)
    else:
        # If not in name, open file and check contents
        full_path = os.path.join(DATA_DIR, f)
        if file_has_year_2015(full_path):
            candidate_2015_files.append(f)

# -------------------- Prepare answers --------------------
answers = {
    "subtask-1": all_files,
    "subtask-2": candidate_water_files,
    "subtask-3": candidate_2015_files,
    "main-task": candidate_2015_files                # same as subtask-3 for this question
}

print(json.dumps(answers, indent=4))
